import React, { useState, useEffect } from "react";

const RecentCard = () => {
  const [cardData, setCardData] = useState([]);


  useEffect(() => {
    let token = localStorage.getItem("Authorization");
    fetch("http://127.0.0.1:8000/api/list/", {
      method: "GET",
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((res) => {
        return res.json();
      })
      .then((result) => {
        console.log(result);
        setTitle(result.title);
      });
  }, []);


  const Clinics = async () => {
    try {
      const recponse = await fetch("http://127.0.0.1:8000/api/list/", {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
      });
      console.log("GETTING RESPONSE");
      setCardData(await recponse.json());
    } catch (error) {}
  };

  return (
    <>
      <div className="content grid3 mtop">
        {cardData.map((cdata, index) => {
          return (
            <div className="box shadow" key={index}>
              <div className="img">
                <img
                  src={`http://127.0.0.1:8000${cdata.images}`}
                  alt="property"
                />
              </div>
              <div className="text">
                <div className="category flex">
                  <span
                    // style={{
                    //   background:
                    //     category === "House" ? "#25b5791a" : "#ff98001a",
                    //   color: category === "House" ? "#25b579" : "#ff9800",
                    // }}
                  >
                    {cdata.category}
                  </span>
                  {/* <i className='fa fa-heart'></i> */}
                </div>
                <h4>{cdata.name}</h4>
                <p>
                  <i className="fa fa-location-dot"></i> {cdata.address}
                </p>
              </div>
              <div className="button flex">
                <div>
                  <button className="btn2">{cdata.price}</button>
                  {/* <label htmlFor=''>/sqft</label> */}
                </div>
                {/* <span>{type}</span> */}
              </div>
            </div>
          );
        })}
      </div>
    </>
  );
};

export default RecentCard;
